contracts/echidna/EchidnaAffiliateProper.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.25;

import {TrudeFactory} from "../TrudeFactory.sol";
import {TrudeVault} from "../TrudeVault.sol";
import {USDCMock} from "../USDCMock.sol";

/**
 * Echidna property-based harness for affiliate/fee tiering and TVL safety.
 */
contract EchidnaAffiliateProperties {
    TrudeFactory public factory;
    TrudeVault public vault;
    USDCMock public usdc;

    constructor() {
        usdc = new USDCMock(1_000_000_000 * 1e6);
        factory = new TrudeFactory();
        factory.initialize(address(this), address(this), 1e6);
        TrudeVault v = new TrudeVault();
        v.initialize(address(factory), address(usdc), address(this), address(this));
        vault = v;
    }

    // Mutators for fuzzing
    function fuzzSetAffiliateShareBps(uint16 bps) external {
        // allowed range [0, 10000]; above reverts, preserving property
        if (bps <= 10_000) {
            factory.setAffiliateShareBps(bps);
        } else {
            // ignore out-of-range
        }
    }

    function fuzzSetMaxFeePercent(uint8 pct) external {
        if (pct <= 100) {
            factory.setMaxFeePercent(pct);
        } else {
            // ignore
        }
    }

    // Properties
    function echidna_affiliate_bps_cap() external view returns (bool) {
        return factory.affiliateShareBps() <= 10_000;
    }

    function echidna_fee_cap_bound() external view returns (bool) {
        return factory.maxFeePercent() <= 100;
    }

    function echidna_tvl_non_negative() external view returns (bool) {
        return vault.totalValueLocked() >= 0;
    }
}

contracts/TrudeAffiliate.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.25;

/**
 * @title TRUDE Affiliate Tracker
 * @notice Keeps lifetime earnings for affiliates.
 * @author TRUDE
 */

import { Initializable } from "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import { OwnableUpgradeable } from "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";

contract TrudeAffiliate is Initializable, OwnableUpgradeable {
    mapping(address => uint256) public totalAffiliateEarnings;

    /**
     * @notice Emitted when an affiliate is credited earnings
     * @param affiliate The affiliate account
     * @param amount The amount recorded for the affiliate
     */
    event AffiliatePaid(address indexed affiliate, uint256 amount);

    // --- Custom errors ---
    error ZeroAffiliate();
    error ZeroAmount();

    /**
     * @notice Initializes the affiliate tracker
     * @param _owner The owner address to set
     */
    function initialize(address _owner) public initializer {
        __Ownable_init();
        transferOwnership(_owner);
    }

    /**
     * @notice Record earnings for an affiliate
     * @param affiliate The affiliate account
     * @param amount The amount to record
     */
    function recordAffiliateEarning(address affiliate, uint256 amount)
        external
        onlyOwner
    {
        if (affiliate == address(0)) revert ZeroAffiliate();
        if (amount == 0) revert ZeroAmount();
        totalAffiliateEarnings[affiliate] += amount;
        emit AffiliatePaid(affiliate, amount);
    }

    /**
     * @notice Get total earnings for an affiliate
     * @param affiliate The affiliate account
     * @return The total recorded earnings
     */
    function getAffiliateEarnings(address affiliate)
        external
        view
        returns (uint256)
    {
        return totalAffiliateEarnings[affiliate];
    }
}

